import React from "react";
import "./App.css";
import { Form } from "./components/Form";

function App() {
  const style = {
    backgroundColor: "#ebebeb"
  };
  return (
    <div className="container-fluid p-5 " style={style}>
      <Form />
    </div>
  );
}

export default App;
